             img1={data.img1} 
             text1={data.text1} 
             T1="#1f1d27" 
             text2={data.text2} 
             T2="#1f1d27" 
             heading={data.heading}
             heading2={data.heading2}  
             paragraph1={data.paragraph1}
              />))}

               {State6.map((data, index) => (
            <Parallax
