            color="#293746" 
            Hcolor="#e8c530" 
            Tcolor="#f4f8ff" 
            img={data.img} 
            img1={data.img1} 
            text1={data.text1} 
            T1="#f4f8ff" 
            text2={data.text2} 
            T2="#e2b62d" 
            heading={data.heading}
            heading2={data.heading2}  
            paragraph1={data.paragraph1} 
            />))}

 {State3.map((data, index) => (
            <Parallax2
             key={index} 
             color="#828884" 
             Hcolor="#ffffff" 
             Tcolor="#f4f8ff" 
             img={data.img} 
             img1={data.img1} 
