             T1="#f4f8ff" 
             text2={data.text2} 
             T2="#f4f8ff" 
             heading={data.heading}
             heading2={data.heading2}  
             paragraph1={data.paragraph1}
              />))}

  {State5.map((data, index) => (
            <Parallax2 
            key={index} 
            color="#b6af9f" 
            Hcolor="#ffffff" 
            Tcolor="#f4f8ff" 
            img={data.img} 
            img1={data.img1} 
            text1={data.text1} 
            T1="#4d6a88" 
            text2={data.text2} 
            T2="#4d6a88" 
            heading={data.heading}
            heading2={data.heading2}  
            paragraph1={data.paragraph1} 
            />))}

    {State3.map((data, index) => (
            <Parallax2
             key={index} 
             color="#828884" 
             Hcolor="#ffffff" 
             Tcolor="#f4f8ff" 
             img={data.img} 
             img1={data.img1} 
             text1={data.text1} 
             T1="#f4f8ff" 
             text2={data.text2} 
             T2="#f4f8ff" 
             heading={data.heading}
             heading2={data.heading2}  
             paragraph1={data.paragraph1}
              />))}

  {State5.map((data, index) => (
            <Parallax2 
            key={index} 
            color="#b6af9f" 
            Hcolor="#ffffff" 
            Tcolor="#f4f8ff" 
            img={data.img} 
            img1={data.img1} 
            text1={data.text1} 
            T1="#4d6a88" 
            text2={data.text2} 
            T2="#4d6a88" 
            heading={data.heading}
            heading2={data.heading2}  
            paragraph1={data.paragraph1} 
            />))}

 <Parallax/>

    </div>
  );
}

export default App;
